import React, { useEffect } from "react"
import image from "../images/lamppost.jpg"

export default function Dashboard() {
   useEffect(() => {
      document.title = "Dashboard"
   }, [])

   return <div id="dashboard">
      <p> Dashboard Content </p>

      <img src={image} />
   </div>
}
